var benchmarkStatus = "";
function runBenchmarks(){
	benchmarkStatus = ""
	
	timeModel("Simple SD", simpleSDTestCase, 0.051, 50);
	timeModel("Complex SD", complexSDTestCase, 10.00, 8);
	timeModel("Simple ABM", simpleABTestCase, 5.58, 8);
	timeModel("Complex ABM", complexABTestCase, 144.14, 3);
	
	console.log(benchmarkStatus);
	alert(benchmarkStatus);
}

function benchmarkPrint(txt){
	console.log(txt);
	benchmarkStatus = benchmarkStatus+txt;
}

function timeModel(name, code, base, reps){
	benchmarkPrint("\n\nBenchmarking "+name+":\n\n");
	importMXGraph(code);
	var times = [];
	var total = 0;
	for(var i = 0; i <= reps; i++){
		if(i<reps){
			benchmarkPrint("Run "+(i+1)+": ");
		}else{
			setAlgorithm("RK4");
			benchmarkPrint("RK4 Test: ");
		}
		var start = Date.now();
		var res = runModel(true);
		if(res.error != "none"){
			benchmarkPrint("***ERROR: "+res.error);
		}
		var diff = (Date.now()-start)/1000;
		if(i<reps){
			times.push(diff);
			total = total + diff;
		}
		benchmarkPrint(diff+" seconds\n");
	}
	
	

	benchmarkPrint("\nAverage: "+total/reps+" seconds\n");
	benchmarkPrint("Compared to base: "+(total/reps)/base*100+"%\n");
	return (total/reps)/base*100;
}

